import React from "react";
import { FaDiscord, FaTwitter } from "react-icons/fa";

const Footer = () => {
  return (
    <div className="text-center">
      <FaDiscord size="2rem" />
      <FaTwitter size="2rem" />
    </div>
  );
};

export default Footer;
